response.activities:
Уважаемые посетители! Мы рады приветствовать Вас на странице нашего интернет-салона профессиональной косметики!
Это необычный проект - для Вашего комфорта и удобства он объединяет в себе профессиональный салон и интернет-магазин. Согласитесь, необычно, но мы надеемся, что Вы оцените его преимущества: 
на странице представлены исключительно профессиональные марки мировых брендов, таких как Kaaral, Lisap (Италия), Erayba (Испания), Lee Stafford (Англия), Estel (Россия); 
у нас Вы сможете приобрести косметику для  волос, а также получить консультацию специалиста по подбору препаратов; 
на сайте размещена полная информация по каждому продукту с подробным описанием и фотографиями; 
если Вы только подбираете для себя косметику - наш мастер проконсультирует Вас и поможет выбрать косметику, учитывая Ваши особенности. 
Постоянно проводятся акции и скидки!
